function HashTable() {
  this.storage = [];
  this.count = 0; // \u4FDD\u5B58\u5DF2\u7ECF\u5B58\u653E\u7684\u603B\u6570\uFF0C\u7528\u4E8E\u8BA1\u7B97\u88C5\u8F7D\u56E0
  this.limit = 7; // \u6570\u7EC4\u957F\u5EA6\uFF0C\u7528\u4E8E\u52A8\u6001\u6269\u5BB9

  HashTable.prototype.hashFunction = function (str, size) {
    // 1.\u5B9A\u4E49hashCode
    var hashCode = 0;
    // 2.\u970D\u7EB3\u7B97\u6CD5\uFF0C\u6765\u8BA1\u7B97hashCode\u7684\u503C
    // \u8FD9\u91CC\u5C31\u91C7\u752837\u4F5C\u4E3A\u516C\u5F0F\u91CC\u7684\u8D28\u6570\uFF08\u65E0\u5F3A\u5236\u8981\u6C42\uFF0C\u8D28\u6570\u5373\u53EF\uFF09
    for (var i = 0; i < str.length; i++) {
      hashCode = 37 * hashCode + str.charCodeAt(i);
    }
    // \u7F29\u5C0FhashCode\u7684\u8303\u56F4
    var index = hashCode % size;
    return index;
  };

  // 1.\u63D2\u5165\u548C\u4FEE\u6539
  HashTable.prototype.put = function (key, value) {
    if (typeof key === 'String') {
      throw new Error('key must be a string');
    }

    // 1.\u6839\u636Ekey\u83B7\u53D6\u5BF9\u5E94\u7684index
    var index = this.hashFunction(key, this.limit);
    var bucket = this.storage[index];
    if (bucket === undefined) {
      bucket = [];
      this.storage[index] = bucket;
    }

    // \u4FEE\u6539\u64CD\u4F5C
    for (var i = 0; i < bucket.length; i++) {
      var tuple = bucket[i];
      if (tuple[0] === key) {
        tuple[1] = value;
        return;
      }
    }

    // \u63D2\u5165\u64CD\u4F5C
    bucket.push([key, value]);
    this.count += 1;

    // \u52A8\u6001\u6269\u5BB9
    if (this.count > this.limit * 0.75) {
      let newLimit = this.getPrime(this.limit * 2);
      this.resize(newLimit);
    }
  };

  // 2.\u83B7\u53D6\u64CD\u4F5C
  HashTable.prototype.get = function (key) {
    if (typeof key === 'String') {
      throw new Error('key must be a string');
    }

    var index = this.hashFunction(key, this.limit);
    var bucket = this.storage[index];

    if (bucket === undefined) return null;
    // \u4ECE bucket \u4E2D\u7EBF\u6027\u67E5\u627Ekey
    for (var i = 0; i < bucket.length; i++) {
      var tuple = bucket[i];
      if (tuple[0] === key) {
        return tuple[1];
      }
    }
    // bucket\u4E2D\u6CA1\u6709\u627E\u5230\u8FD4\u56DE null
    return null;
  };

  // 3.\u5220\u9664\u64CD\u4F5C
  HashTable.prototype.remove = function (key) {
    if (typeof key === 'String') {
      throw new Error('key must be a string');
    }

    var index = this.hashFunction(key, this.limit);
    var bucket = this.storage[index];

    if (bucket === undefined) return null;

    for (var i = 0; i < bucket.length; i++) {
      var tuple = bucket[i];
      if (tuple[0] === key) {
        bucket.splice(i, 1);
        this.count -= 1;
        // \u52A8\u6001\u51CF\u5C11\u5BB9\u91CF
        if (this.limit > 7 && this.count < this.limit * 0.25) {
          let newLimit = this.getPrime(this.limit * 2);
          this.resize(newLimit);
        }
        return tuple[1];
      }
    }

    return null;
  };

  HashTable.prototype.isEmpty = function () {
    return this.count === 0;
  };

  HashTable.prototype.size = function () {
    return this.count;
  };

  // 4.\u54C8\u5E0C\u8868\u6269\u5BB9
  HashTable.prototype.resize = function (newLimit) {
    var oldStorage = this.storage;
    this.storage = [];
    this.count = 0;
    this.limit = newLimit;
    for (var i = 0; i < oldStorage.length; i++) {
      var bucket = oldStorage[i];
      if (bucket === undefined) continue;

      for (var j = 0; j < bucket.length; j++) {
        var tuple = bucket[j];
        this.put(tuple[0], tuple[1]);
      }
    }
  };

  // \u5224\u65AD\u662F\u5426\u4E3A\u8D28\u6570
  HashTable.prototype.isPrime = function (number) {
    var temp = parseInt(Math.sqrt(number));
    for (var i = 2; i <= temp; i++) {
      if (number % i === 0) {
        return false;
      }
    }
    return true;
  };

  // \u83B7\u53D6\u4E00\u4E2A\u8D28\u6570
  HashTable.prototype.getPrime = function (number) {
    while (!this.isPrime(number)) {
      number += 1;
    }
    return number;
  };
}

//\u6D4B\u8BD5\u4EE3\u7801

var ht = new HashTable();
ht.put('abc', '111');
ht.put('cba', '222');
ht.put('nba', '333');
console.log(ht);
console.log(ht.get('abc')); // ? 111
console.log(ht.get('cba')); // ? 222
console.log(ht.get('nba')); // ? 333

ht.put('abc', '444');
console.log(ht.get('abc')); // ? 444
ht.remove('abc');
console.log(ht.get('abc')); // ? null
