`,paraId:0},{value:"120.\u4E09\u89D2\u5F62\u6700\u5C0F\u8DEF\u5F84\u548C",paraId:0},{value:"medium",paraId:0},{value:`/**
 * @param {number[][]} triangle
 * @return {number}
 */
var minimumTotal = function (triangle) {
    const n = triangle.length;
    // \u5B9A\u4E49dp[i][j]\u8868\u793A\u4ECEtriangle [0][0]\u5230[i][j]\u7684\u8DEF\u5F84\u548C
    const dp = new Array(n).fill().map(_ => new Array(n).fill(Infinity));
    //base case
    dp[0][0] = triangle[0][0];

    for (let i = 1; i < n; i++) {
        for (let j = 0; j < triangle[i].length; j++) {
            if (j === 0) {
                dp[i][j] = triangle[i][j] + dp[i - 1][j];
            } else {
                dp[i][j] = triangle[i][j] + Math.min(dp[i - 1][j], dp[i - 1][j - 1]);
            }
        }
    }

    const lastSumArr = dp[n - 1];
    return Math.min.apply(null, lastSumArr);
};
`,paraId:0},{value:"139.\u5355\u8BCD\u62C6\u5206",paraId:0},{value:"medium",paraId:0},{value:`/**
 * @param {string} s
 * @param {string[]} wordDict
 * @return {boolean}
 */
var wordBreak = function (s, wordDict) {
  const memo = new Array(s.length + 1).fill(-1);
  // \u5B9A\u4E49dp\u51FD\u6570
  // \u8FD4\u56DEs[i,...]\u80FD\u5426\u7528wordDict\u62FC\u6210
  const dp = (i) => {
    // base case
    if (i === s.length) return true;

    if (memo[i] !== -1) return memo[i];

    for (const word of wordDict) {
      const len = word.length;
      if (i + len > s.length) continue; // \u8D8A\u754C

      const subStr = s.substring(i, i + len);
      if (subStr !== word) continue; // \u5F00\u5934\u4E0D\u76F8\u7B49\u76F4\u63A5\u8DF3\u8FC7
      // \u5982\u679Cdp[i,...]\u53EF\u4EE5\u88AB\u62FC\u51FA
      // \u5224\u65AD dp[i+len,...]\u80FD\u5426\u88AB\u62FC\u51FA
      if (dp(i + len)) {
        memo[i] = true;
        return true;
      }
    }

    // s[i,...]\u4E0D\u80FD\u88AB\u62FC\u51FA
    memo[i] = false;
    return false;
  };

  return dp(0);
};
`,paraId:0},{value:"152.\u4E58\u79EF\u6700\u5927\u5B50\u6570\u7EC4",paraId:0},{value:"medium",paraId:0},{value:`/**
 * @param {number[]} nums
 * @return {number}
 */
var maxProduct = function (nums) {
  const n = nums.length;
  if (n === 1) return nums[0];
  let max = 1; // \u7EF4\u62A4i\u4F4D\u7F6E\u7684\u6700\u5927\u503C
  let min = 1; // \u7EF4\u62A4i\u4F4D\u7F6E\u7684\u6700\u5C0F\u503C
  let res = -Infinity;

  for (const num of nums) {
    if (num < 0) {
      // \u5F53num\u4E3A\u8D1F\u6570
      // \u6700\u5927\u503C\u548C\u6700\u5C0F\u503C\u4EA4\u6362
      let temp = min;
      min = max;
      max = temp;
    }
    max = Math.max(max * num, num);
    min = Math.min(min * num, num);
    res = Math.max(res, max);
  }
  return res;
};
`,paraId:0},{value:"174.\u5730\u4E0B\u57CE\u6E38\u620F",paraId:0},{value:"hard",paraId:0},{value:`/**
 * @param {number[][]} dungeon
 * @return {number}
 */
// \u52A8\u6001\u8F6C\u79FB\uFF1A res = min(dp(i+1,j), dp(i,j+1)) - nums[i][j];
var calculateMinimumHP = function (dungeon) {
  let m = dungeon.length,
    n = dungeon[0].length;
  let memo = Array.from({ length: m }).map((_) =>
    Array.from({ length: n }).fill(-1)
  );

  // \u8868\u793A\u4ECEnums[i][j] \u5230\u8FBE\u53F3\u4E0B\u89D2\u81F3\u5C11\u9700\u8981\u7684\u8840\u91CF
  const dp = (nums, i, j) => {
    // base case
    // \u5F53i,j\u672C\u8EAB\u5C31\u662F\u53F3\u4E0B\u89D2
    if (i === m - 1 && j === n - 1) {
      return nums[i][j] >= 0 ? 1 : -nums[i][j] + 1;
    }
    // \u8D8A\u754C\u60C5\u51B5\u5224\u65AD
    if (i === m || j === n) return Infinity;

    if (memo[i][j] !== -1) return memo[i][j];
    let res = Math.min(dp(nums, i + 1, j), dp(nums, i, j + 1)) - nums[i][j];
    memo[i][j] = res > 0 ? res : 1;
    return memo[i][j];
  };

  // \u90A3\u4E48\u6211\u4EEC\u6240\u6C42\u7684\u5C31\u662F\u4ECEnums[0][0]\u5230\u8FBE\u53F3\u4E0B\u89D2\u9700\u8981\u7684\u8840\u91CF
  return dp(dungeon, 0, 0);
};
