// \u5143\u7D20\u3010\u65E0\u91CD\u3011\u3010\u4E0D\u53EF\u590D\u9009\u3011
// \u9700\u8981\u4F7F\u7528start,\u4FDD\u8BC1\u5143\u7D20\u65E0\u91CD
var subsets = function (nums) {
  const res = [];

  const backTrack = (start, track) => {
    res.push([...track]);
    for (let i = start; i < nums.length; i++) {
      // \u505A\u9009\u62E9
      track.push(nums[i]);
      backTrack(i + 1, track); // i+1,\u4FDD\u8BC1\u4E0B\u6B21\u8FDB\u5165\uFF0C\u4E0D\u4F1A\u518D\u6B21\u9009\u4E2Di\u4E0A\u7684\u5143\u7D20
      // \u64A4\u9500\u9009\u62E9
      track.pop();
    }
  };
  backTrack(0, []);
  return res;
};
`,paraId:0},{value:"79.\u5355\u8BCD\u641C\u7D22",paraId:0},{value:"medium",paraId:0},{value:"\u9898\u89E3",paraId:3,tocIndex:9},{value:`/**
 * @param {character[][]} board
 * @param {string} word
 * @return {boolean}
 */
var exist = function (board, word) {
  const m = board.length,
    n = board[0].length;
  // false\u8868\u793A\u672A\u8BBF\u95EE\uFF0Ctrue\u8868\u793A\u8BBF\u95EE\u8FC7
  const visited = new Array(m).fill().map((_) => new Array(n).fill(false));
  const len = word.length;

  // \u5B9A\u4E49\u51FD\u6570
  // \u8FD4\u56DE [i,j]\u4E3A\u8D77\u70B9\u80FD\u591F\u627E\u51FA word[p..end]
  const canFind = (i, j, p) => {
    if (p === len) {
      // p\u6307\u9488\u8D8A\u754C\u4E86\uFF0C\u8FD4\u56DEtrue
      return true;
    }

    // \u8D8A\u754C\u76F4\u63A5\u8FD4\u56DEfalse
    if (i < 0 || i >= m || j < 0 || j >= n) return false;
    // \u8BBF\u95EE\u8FC7 \u6216\u8005\u4E0D\u662F\u8981\u5BFB\u627E\u7684\u76EE\u6807 \u4E5F\u8FD4\u56DEfalse
    if (visited[i][j] || board[i][j] !== word[p]) return false;

    // \u5269\u4E0B\u7684\u60C5\u51B5\u5C31\u662F board[i][j] === word[p]

    visited[i][j] = true; // \u8BBF\u95EE
    // \u8BBF\u95EE\u4E0A\u4E0B\u5DE6\u53F3
    const canFindRes =
      canFind(i, j + 1, p + 1) ||
      canFind(i, j - 1, p + 1) ||
      canFind(i + 1, j, p + 1) ||
      canFind(i - 1, j, p + 1);

    if (canFindRes) return true; // \u5982\u679C\u80FD\u627E\u5230 \u8FD4\u56DEtrue

    visited[i][j] = false; // \u64A4\u9500\u8BBF\u95EE
    return false;
  };

  for (let i = 0; i < m; i++) {
    for (let j = 0; j < n; j++) {
      if (board[i][j] === word[0] && canFind(i, j, 0)) {
        return true;
      }
    }
  }
  return false;
};
`,paraId:0},{value:"90.\u5B50\u96C6-ii",paraId:0},{value:"medium",paraId:0},{value:"\u601D\u8DEF",paraId:0},{value:"\u89E3\u6CD5\u8FD8\u662F\u548C78.\u5B50\u96C6\u4E00\u6837",paraId:0},{value:"\u4E0D\u8FC7\u56E0\u4E3A\u9898\u76EE\u5305\u542B\u91CD\u590D\u5143\u7D20\uFF0C\u6240\u4EE5\u5728\u6392\u5217\u7684\u65F6\u5019\uFF0C\u8981\u628A\u91CD\u590D\u7684\u5143\u7D20\u7ED9\u8FC7\u6EE4\u6389",paraId:0},{value:"\u4E5F\u5C31\u662F\u5BF9\u6811\u8FDB\u884C\u526A\u679D\u64CD\u4F5C",paraId:0},{value:"\u4F53\u73B0\u5728\u4EE3\u7801\u4E0A\uFF0C\u9700\u8981\u5148\u8FDB\u884C\u6392\u5E8F\uFF0C\u8BA9\u76F8\u540C\u7684\u5143\u7D20\u9760\u5728\u4E00\u8D77\uFF0C\u5982\u679C\u53D1\u73B0 nums[i] == nums[i-1]\uFF0C\u5219\u8DF3\u8FC7",paraId:0},{value:`/**
 * @param {number[]} nums
 * @return {number[][]}
 */
// \u5143\u7D20\u3010\u53EF\u91CD\u3011\u3010\u4E0D\u53EF\u590D\u9009\u3011
// \u8981\u70B9\uFF1A\u8FDB\u884C\u526A\u679D
// \u5982\u679C\u4E00\u4E2A\u8282\u70B9\u6709\u591A\u6761\u503C\u76F8\u540C\u7684\u6811\u679D\u76F8\u90BB\uFF0C\u5219\u53EA\u904D\u5386\u7B2C\u4E00\u6761\uFF0C\u5269\u4E0B\u7684\u90FD\u526A\u6389\uFF0C\u4E0D\u8981\u53BB\u904D\u5386
var subsetsWithDup = function (nums) {
  const res = [];
  nums.sort((a, b) => a - b);

  const backTrack = (start, track) => {
    res.push([...track]);

    for (let i = start; i < nums.length; i++) {
      // \u526A\u679D
      if (i > start && nums[i] === nums[i - 1]) {
        continue;
      }
      // \u505A\u9009\u62E9
      track.push(nums[i]);
      backTrack(i + 1, track);
      // \u64A4\u9500\u9009\u62E9
      track.pop();
    }
  };

  backTrack(0, []);
  return res;
};
`,paraId:0},{value:"216.\u7EC4\u5408\u603B\u548C-iii",paraId:0},{value:"medium",paraId:0},{value:`/**
 * @param {number} k
 * @param {number} n
 * @return {number[][]}
 */
// \u5143\u7D20\u3010\u65E0\u91CD\u3011\u3010\u4E0D\u53EF\u590D\u9009\u3011
// \u4F7F\u7528\u6570\u5B571-9
// n\u4E3Atarget
// k\u4E3A\u7EC4\u6210target\u6240\u9700\u8981\u7684\u5143\u7D20\u4E2A\u6570
var combinationSum3 = function (k, n) {
  const nums = new Array(9).fill(0).map((_, i) => i + 1);
  const res = [];
  let targetSum = 0;
  const backTrack = (start, track) => {
    // base case
    if (track.length === k && targetSum === n) {
      res.push([...track]);
      return;
    }
    if (track.length > k || targetSum > n) return;
    for (let i = start; i < nums.length; i++) {
      // \u505A\u9009\u62E9
      track.push(nums[i]);
      targetSum += nums[i];

      backTrack(i + 1, track);
      // \u64A4\u9500\u9009\u62E9
      track.pop();
      targetSum -= nums[i];
    }
  };
  backTrack(0, []);
  return res;
};
`,paraId:0},{value:"491.\u9012\u589E\u5B50\u5E8F\u5217",paraId:0},{value:"medium",paraId:0},{value:"\u8FD9\u9053\u9898\u548C40\u9898\u5F88\u50CF",paraId:0},{value:"\u4E0D\u8FC7\u589E\u52A0\u4E86\u4E00\u4E2A\u6761\u4EF6\uFF1A\u5143\u7D20\u5FC5\u987B\u662F\u9012\u589E\u7684\uFF0C\u6240\u4EE5\u6211\u4EEC\u9700\u8981\u6DFB\u52A0\u4E00\u4E2A\uFF0C track[last] > nums[i]\u8FDB\u884C\u8FC7\u6EE4\uFF0C\u4FDD\u8BC1\u5143\u7D20\u9012\u589E",paraId:0},{value:"\u8FD8\u6709\u4E00\u70B9\uFF0C\u572840\u9898\u4E2D\uFF0C\u6211\u4EEC\u5BF9nums\u8FDB\u884C\u6392\u5E8F\uFF0C\u8FDB\u884C\u526A\u679D\uFF0C\u8FD9\u91CC\u4E0D\u80FD\u4FEE\u6539\u539F\u6570\u7EC4\uFF0C\u6211\u4EEC\u4F7F\u7528set\u526A\u679D\uFF0C\u907F\u514D\u4F7F\u7528\u91CD\u590D\u7684\u5143\u7D20",paraId:0},{value:`/**
 * @param {number[]} nums
 * @return {number[][]}
 */
// \u5143\u7D20\u3010\u53EF\u91CD\u3011\u3010\u4E0D\u53EF\u590D\u9009\u3011
// \u6CE8\u610F\u526A\u679D
var findSubsequences = function (nums) {
  const res = [];
  const backTrack = (start, track) => {
    // base case
    if (track.length >= 2) {
      res.push([...track]);
    }
    const set = new Set(); // \u5728\u4E00\u4E2A\u9012\u5F52\u4E2D\u53BB\u91CD
    for (let i = start; i < nums.length; i++) {
      // \u4FDD\u8BC1track\u7684\u7ED3\u679C\u662F\u5347\u5E8F\u7684
      if (track.length !== 0 && track[track.length - 1] > nums[i]) continue;
      if (set.has(nums[i])) continue; // \u4FDD\u8BC1\u4E0D\u91CD\u590D\u4F7F\u7528\u76F8\u540C\u7684\u5143\u7D20
      // \u505A\u9009\u62E9
      track.push(nums[i]);
      set.add(nums[i]);
      backTrack(i + 1, track);
      // \u64A4\u9500\u9009\u62E9
      track.pop();
    }
  };
  backTrack(0, []);
  return res;
};
`,paraId:0},{value:"733.\u56FE\u50CF\u6E32\u67D3",paraId:0},{value:"easy",paraId:0},{value:`/**
 * @param {number[][]} image
 * @param {number} sr
 * @param {number} sc
 * @param {number} color
 * @return {number[][]}
 */
var floodFill = function (image, sr, sc, color) {
    const m = image.length, n = image[0].length;
    const origColor = image[sr][sc];
    const fill = (i, j) => {
        if (i < 0 || j < 0 || i >= m || j >= n) return; // \u8D8A\u754C\u60C5\u51B5
        if (image[i][j] !== origColor) return; // \u4E0D\u662F[sr,sc]\u70B9\u7684color
        if (image[i][j] === -1) return;

        image[i][j] = -1; // \u4F7F\u7528-1\u6807\u8BC6\u5DF2\u7ECF\u8D70\u8FC7
        fill(i - 1, j);
        fill(i + 1, j);
        fill(i, j + 1);
        fill(i, j - 1);
        image[i][j] = color; // \u5728\u9012\u5F52\u5411\u4E0A\u56DE\u6EAF\u7684\u65F6\u5019\u8BBE\u7F6E\u4E3A\u65B0\u7684color
    }
    fill(sr, sc);
    return image;
};
`,paraId:0},{value:"784.\u5B57\u6BCD\u5927\u5C0F\u5199\u5168\u6392\u5217",paraId:0},{value:"medium",paraId:0},{value:"\u56DE\u6EAF",paraId:4,tocIndex:14},{value:`
