// \u5143\u7D20\u3010\u65E0\u91CD\u3011\u3010\u53EF\u590D\u9009\u3011
var combinationSum = function (candidates, target) {
  const res = [];
  let targetSum = 0;
  const backTrack = (start, track) => {
    // base case
    if (targetSum === target) {
      res.push([...track]);
      return;
    }
    // \u56E0\u4E3AtargetSum\u662F\u7D2F\u52A0\u7684\uFF0C\u6240\u4EE5\u5F53targetSum > target\u662F\uFF0C\u53EF\u4EE5\u76F4\u63A5\u505C\u6B62\u9012\u5F52
    if (targetSum > target) return;
    for (let i = start; i < candidates.length; i++) {
      // \u505A\u9009\u62E9
      track.push(candidates[i]);
      targetSum += candidates[i];
      backTrack(i, track);
      // \u64A4\u9500\u9009\u62E9
      track.pop();
      targetSum -= candidates[i];
    }
  };
  backTrack(0, []);
  return res;
};
`,paraId:0},{value:"\u5251\u6307 Offer II 082. \u542B\u6709\u91CD\u590D\u5143\u7D20\u96C6\u5408\u7684\u7EC4\u5408",paraId:0},{value:"medium",paraId:0},{value:"\u672C\u9898\u4E0E\u4E3B\u7AD9 40 \u9898\u76F8\u540C",paraId:10,tocIndex:19},{value:`/**
 * @param {number[]} candidates
 * @param {number} target
 * @return {number[][]}
 */
// \u5143\u7D20\u3010\u53EF\u91CD\u3011\u3010\u4E0D\u53EF\u590D\u9009\u3011
// \u6CE8\u610F\u526A\u679D
var combinationSum2 = function (candidates, target) {
  const res = [];
  let targetSum = 0;
  candidates.sort((a, b) => a - b);

  const backTrack = (start, track) => {
    // base case
    if (targetSum === target) {
      res.push([...track]);
      return;
    }
    // \u56E0\u4E3AtargetSum\u662F\u7D2F\u52A0\u7684\uFF0C\u6240\u4EE5\u5F53targetSum > target\u662F\uFF0C\u53EF\u4EE5\u76F4\u63A5\u505C\u6B62\u9012\u5F52
    if (targetSum > target) return;

    for (let i = start; i < candidates.length; i++) {
      // \u5BF9\u91CD\u590D\u7684\uFF0C\u53EA\u904D\u5386\u4E00\u6B21
      if (i > start && candidates[i] === candidates[i - 1]) continue;
      // \u505A\u9009\u62E9
      track.push(candidates[i]);
      targetSum += candidates[i];
      backTrack(i + 1, track);
      // \u64A4\u9500\u9009\u62E9
      track.pop();
      targetSum -= candidates[i];
    }
  };
  backTrack(0, []);
  return res;
};
