// DFS\u89E3\u6CD5
var minDepthDFS = function (root) {
  let res = Infinity;
  const traverse = (root, deep) => {
    if (root === null) return;
    if (root.left === null && root.right === null) {
      res = Math.min(deep, res);
    }
    traverse(root.left, deep + 1);
    traverse(root.right, deep + 1);
  };
  traverse(root, 1);
  return res === Infinity ? [] : res;
};
