// \u5229\u7528\u4E8C\u53C9\u641C\u7D22\u6811\u4E2D\u5E8F\u904D\u5386\u6709\u5E8F\u7684\u7279\u6027
var kthSmallest = function (root, k) {
  // const res = [];
  let kVal,
    n = 0;
  const traverse = (root) => {
    if (root === null) return;
    traverse(root.left);
    // res.push(root.val);
    n++;
    if (n === k) {
      kVal = root.val;
      return;
    }
    traverse(root.right);
  };
  traverse(root);
  // return res[k - 1];
  return kVal;
};
