`,paraId:0},{value:"15.\u4E09\u6570\u4E4B\u548C",paraId:0},{value:"medium",paraId:0},{value:"\u4F7F\u7528\u6539\u9020 twoSum \u7684\u89E3\u6CD5",paraId:0},{value:"\u5148\u628A\u6839\u636E\u5F53\u524D nums[i]\u627E\u51FA target \u4E3A",paraId:0},{value:"0-nums[i]",paraId:0},{value:"\u7684\u6570\u7EC4",paraId:0},{value:"\u7136\u540E\u518D\u628A nums[i]\u52A0\u5165\u627E\u5230\u7684\u6570\u7EC4\u4E2D",paraId:0},{value:"\u6CE8\u610F:\u5982\u679C nums[i]\u548C nums[i+1]\u5982\u679C\u76F8\u7B49\uFF0C\u7ED3\u679C\u4F1A\u91CD\u590D\uFF0C\u6240\u4EE5\u9700\u8981\u8DF3\u8FC7\u76F8\u90BB\u7684",paraId:0},{value:`// \u4F7F\u7528\u6539\u9020twoSum\u7684\u89E3\u6CD5
var twoSumTarget = function (nums, start, target) {
  let lo = start,
    hi = nums.length - 1;
  let res = [];
  while (lo < hi) {
    let left = nums[lo],
      right = nums[hi];
    let sum = left + right;

    if (sum === target) {
      res.push([left, right]);
      // \u53BB\u9664\u91CD\u590D\u7B54\u6848
      while (lo < hi && nums[lo] === left) lo++;
      while (lo < hi && nums[hi] === right) hi--;
    } else if (sum < target) {
      lo++;
    } else if (sum > target) {
      hi--;
    }
  }

  return res;
};

/**
 * @param {number[]} nums
 * @return {number[][]}
 */
var threeSum = function (nums) {
  nums.sort((a, b) => a - b);
  const res = [];
  const len = nums.length;
  for (let i = 0; i < len; i++) {
    let twoSumRes = twoSumTarget(nums, i + 1, 0 - nums[i]);

    for (const item of twoSumRes) {
      item.push(nums[i]);
      res.push(item);
    }

    // \u53BB\u9664\u91CD\u590D\u7B54\u6848
    while (i < len - 1 && nums[i] === nums[i + 1]) i++;
  }

  return res;
};
